import '../App.css';
import logo from '../assets/logo.svg';
import {BrowserRouter, Link} from "react-router-dom";

let pages=['About Us', 'Data Findings', 'Top 10 Roads', 'Live Map', 'Machine Learning Map'];
let links=['/about', '/dataFindings', '/top10', '/liveMap', '/mlMap']

function Navbar() {
  return (
    <div className="navbar-content-area">
        <div className="navbar-containers">
            <div className="navbar-page-titles-container">
                <div>
                    <img src={logo} className="company-logo" alt="logo" />
                </div>
                <div className="navbar-company-logo-text">
                    Whether Weather
                </div>
            </div>
            <div className="navbar-page-titles-container">
                {pages.map((item,index)=>{
                    return <div>
                        {links.map((link, index)=> {
                            return <Link to={link} key={index} className="navbar-page-titles">{item}</Link>
                        })}
                    </div>
                })}
            </div>
        </div>

    </div>
  );
}

export default Navbar;
